import React, { useState } from "react";
import { Link } from "react-router-dom";

function Nav() {
  const [activeNav, setAcvtiveNav] = useState(false);
  function navToggle() {
    if (!activeNav) {
      setAcvtiveNav(() => true);
    } else {
      setAcvtiveNav(() => false);
    }
  }
  return (
    <div>
      <nav>
        <div className="nav-links" id="nav-links">
          <Link className="webNavLink" to="#home">
            HOME
          </Link>
          <Link to="#mainAboutCon" className="webNavLink">
            ABOUT
          </Link>
          <Link to="#services" className="webNavLink">
            WORK
          </Link>
          <Link to="#contact" className="webNavLink">
            CONTACT
          </Link>

          {/* <a href="#home">HOME</a>
          <a href="#mainAboutCon">ABOUT</a>
          <a href="#services">WORK</a>
          <a href="#contact">CONTACT</a> */}
        </div>
      </nav>
      <div className="mobileHamburgerMenu">
        <button
          type="button"
          className="mobileHamburgerMenuBtn"
          onClick={navToggle}>
          <div className="hamLine line1" id="hamline1"></div>
          <div className="hamLine" id="hamline2"></div>
        </button>
      </div>
      <div
        className={activeNav ? "navMobileLinks activateNav" : "navMobileLinks"}>
        <div className="mobileLinks">
          <Link className="mobileNavLink" to="#home">
            HOME
          </Link>
          <Link to="#mainAboutCon" className="#mobileNavLink">
            ABOUT
          </Link>
          <Link to="#services" className="mobileNavLink">
            WORK
          </Link>
          <Link to="#contact" className="mobileNavLink">
            CONTACT
          </Link>
        </div>
      </div>{" "}
    </div>
  );
}

export default Nav;
